    "Create an account using": "\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e1a\u0e31\u0e0d\u0e0a\u0e35\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19",
    "Create team.": "\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e17\u0e35\u0e21",
    "Creating missing groups": "\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e01\u0e25\u0e38\u0e48\u0e21\u0e17\u0e35\u0e48\u0e2b\u0e32\u0e22\u0e44\u0e1b",
    "Criterion Added": "\u0e40\u0e01\u0e13\u0e11\u0e4c\u0e1e\u0e34\u0e08\u0e32\u0e23\u0e13\u0e32\u0e40\u0e1e\u0e34\u0e48\u0e21\u0e40\u0e15\u0e34\u0e21",
    "Criterion Deleted": "\u0e40\u0e01\u0e13\u0e11\u0e4c\u0e1e\u0e34\u0e08\u0e32\u0e23\u0e13\u0e32\u0e16\u0e39\u0e01\u0e25\u0e1a",
    "Crossed out items have been refunded.": "\u0e02\u0e35\u0e14\u0e06\u0e48\u0e32\u0e2a\u0e34\u0e48\u0e07\u0e17\u0e35\u0e48\u0e0a\u0e33\u0e23\u0e30\u0e41\u0e25\u0e49\u0e27",
    "Current conversation": "\u0e2b\u0e31\u0e27\u0e02\u0e49\u0e2d\u0e01\u0e32\u0e23\u0e2a\u0e19\u0e17\u0e19\u0e32\u0e1b\u0e31\u0e08\u0e08\u0e38\u0e1a\u0e31\u0e19",
    "Current tab": "\u0e41\u0e17\u0e47\u0e1a\u0e1b\u0e31\u0e08\u0e08\u0e38\u0e1a\u0e31\u0e19",
    "Date": "\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48",
