    "Verified Status": "\u0e15\u0e23\u0e27\u0e07\u0e2a\u0e2d\u0e1a\u0e2a\u0e16\u0e32\u0e19\u0e30\u0e41\u0e25\u0e49\u0e27",
    "Verify Now": "\u0e17\u0e33\u0e01\u0e32\u0e23\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e40\u0e14\u0e35\u0e4b\u0e22\u0e27\u0e19\u0e35\u0e49:",
    "Video Capture Error": "\u0e02\u0e49\u0e2d\u0e1c\u0e34\u0e14\u0e1e\u0e25\u0e32\u0e14\u0e43\u0e19\u0e01\u0e32\u0e23\u0e08\u0e31\u0e1a\u0e20\u0e32\u0e1e\u0e27\u0e34\u0e14\u0e35\u0e42\u0e2d",
    "View": "\u0e14\u0e39",
    "View %(span_start)s %(team_name)s %(span_end)s": "\u0e01\u0e32\u0e23\u0e40\u0e02\u0e49\u0e32\u0e0a\u0e21 %(span_start)s %(team_name)s %(span_end)s",
    "View Cohort": "\u0e14\u0e39\u0e01\u0e25\u0e38\u0e48\u0e21",
